var Ac4yLifecycleConstant=require("../constant/Ac4yLifecycleConstant.js"); 

var Ac4yLifecycleFact=require("./Ac4yLifecycleFact.js");

class Ac4yLCFState extends Ac4yLifecycleFact {
    
    constructor(object){
        
        super(object);
        if (object != undefined && object === 0) return;
        
        this.setDimension(new Ac4yLifecycleConstant().DIMENSION.state);
                
    } // constructor
    
    createSelf(object) {return new Ac4yLCFState(object);}
    
} // Ac4yLCFState

module.exports=Ac4yLCFState
